import "./App.css";
import { Row, Col } from "react-bootstrap";

import Container from "react-bootstrap/Container";
import Avator from "./components/Avator";
import Header from "./components/Header";
import TextBlock from "./components/TextBlock";
import Foto from "./components/Foto";
import SlideShow from "./components/SlideShow";
import Kard from "./components/Kard";
import { music } from "./info";
import Skill from "./components/Skill";

function App() {
  return (
    <Container>
      <Header></Header>
      <h3>Hello, thanks for visiting this page. ðŸ˜€</h3>
      <br />

      <Avator></Avator>
      <br />
      <TextBlock
        title="Where I am from?"
        content="some description"
      ></TextBlock>
      <div className="bottomSpace"></div>
      <Foto path="./images/wuzhen.jpeg" alt="a photo of wuzhen"></Foto>

      <TextBlock
        title="What I like to eat??"
        content="some description"
      ></TextBlock>
      <SlideShow></SlideShow>

      <TextBlock
        title="What kind of music I enjoy listening?"
        content="some description"
      ></TextBlock>
      <Row>
        {music.map((item) => {
          return (
            <Col>
              <Kard path={item.path} title={item.title} text={item.text}></Kard>
            </Col>
          );
        })}
      </Row>

      <Skill></Skill>
    </Container>
  );
}

export default App;
